import React from 'react';
import logo from './logo.svg';
import './App.css';
import { Button, Alert, Breadcrumb, Card, Image } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

import honoluluImage from './images/honolulu.jpeg';

import { Navbar, Nav, NavDropdown, Container } from 'react-bootstrap';
import * as Icon from 'react-bootstrap-icons';


function NavBar() {
  return (
    <>
    <Navbar bg="dark" variant="dark" expand="lg">
      <Container align="right">
      <Navbar.Brand href="/">Place Holder Brand</Navbar.Brand>
      <Navbar.Toggle aria-controls="basic-navbar-nav" />
      <Navbar.Collapse id="basic-navbar-nav">
      <Nav className="me-auto">

        <Nav.Link href="/"> Home</Nav.Link>
        <Nav.Link href="/sermon"> Sermon </Nav.Link>
        <Nav.Link href="/fellowship"> Fellowship </Nav.Link>
        <Nav.Link href="/contact"> Contact </Nav.Link>


        <NavDropdown align="right"title="Our Mission" id="basic-nav-dropdown">
              <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
              <NavDropdown.Item href="#action/3.2">
                Another action
              </NavDropdown.Item>
              <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
              <NavDropdown.Divider />
              <NavDropdown.Item href="#action/3.4">
                Separated link
              </NavDropdown.Item>
        </NavDropdown>

      </Nav>
      </Navbar.Collapse>

      </Container>
    </Navbar>

    </>
  );
}


function App() {
  return (
    <div style={{ position: 'relative' }}>
      <NavBar/>
      <Image src={honoluluImage} alt="Honolulu" fluid style={{ width: '100%', height: 'auto' }} />

      <header className="App-header">
      </header>
    </div>
  );
}

export default App;
